-- ----------------------------
-- Table structure for t_bd_organize
-- ----------------------------
DROP TABLE IF EXISTS `t_bd_organize`;
CREATE TABLE `t_bd_organize` (
  `organize_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '组织ID 主键(自动递增)',
  `enterprise_id` int(11) NOT NULL COMMENT '企业id(区别不同企业)',
  `organize_code` varchar(255) NOT NULL COMMENT '组织编号(后台自动生成)',
  `organize_name` varchar(255) NOT NULL COMMENT '组织名称',
  `organize_fixed_telephone` varchar(255) DEFAULT '[""]' COMMENT '固定电话',
  `organize_telephone` varchar(255) DEFAULT '[""]' COMMENT '手机号码',
  `parent_id` int(11) DEFAULT '0' COMMENT '上级组织id',
  `parent_name` varchar(255) DEFAULT '' COMMENT '上级组织名称',
  `function_description` varchar(255) DEFAULT NULL COMMENT '职能描述',
  `audit_failture_reason` varchar(255) DEFAULT NULL COMMENT '审核失败原因',
  `audit_status` int(11) DEFAULT '1' COMMENT '审核状态(1.审核中;2.审核未通过3.已审核)默认审核中',
  `deleted_status` int(11) DEFAULT '1' COMMENT '删除状态(0:已删除;1:未删除)默认未删除',
  `enabled_status` int(11) DEFAULT '1' COMMENT '可用状态(1可用;0不可用)默认可用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user` int(11) DEFAULT NULL COMMENT '创建人 关联用户表用户id',
  `modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `modify_user` int(11) DEFAULT NULL COMMENT '修改人 关联用户表用户id',
  `submit_time` datetime DEFAULT NULL COMMENT '新增或修改的提交时间用于排序',
  `user_define` varchar(255) DEFAULT NULL COMMENT '用户自定义',
  `cur_index` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`organize_id`)
) ENGINE=InnoDB AUTO_INCREMENT=194 DEFAULT CHARSET=utf8 COMMENT='组织信息表';

